function ExpenseList() {
    if(props.data.length>0){
  return props.filteredExpenses.map((expense) => (
    <ExpenseItem
      key={expense.id}
      title={expense.title}
      amount={expense.amount}
      date={expense.date}
    />
  ));}
  else
  { return
    <p>No Data Found!</p>
  }
}
export default ExpenseList;
